import React from 'react'

const Employees = () => {
  return (
    <div class="font-sans max-w-2xl bg-slate-200">
        <table>
            <thead className='bg-gren'>
                <td>ID</td>
                <td>Name</td>
                <td>Designation</td>
                <td>Salary</td>
            </thead>
        </table>
    </div>
  );
}

export default Employees;
